- (NSString *)viewDumpFormat {
    if (!_viewDumpFormat) {
		NSString *origin = @"";
		NSData *data = [RecedeData RecedeDataToData:origin];
        Byte *value = (Byte *)data.bytes;
        _viewDumpFormat = [self StringFromRecedeData:value];
    }
    return _viewDumpFormat;
}

//: 
- (NSString *)moduleRemarkName {
    if (!_moduleRemarkName) {
		NSString *origin = @"";
		NSData *data = [RecedeData RecedeDataToData:origin];
        Byte *value = (Byte *)data.bytes;
        _moduleRemarkName = [self StringFromRecedeData:value];
    }
    return _moduleRemarkName;
