- (Byte *)RecedeDataToCache:(Byte *)data {
    int approve = data[0];
    int perspective = data[1];
    for (int i = 0; i < approve / 2; i++) {
        int begin = perspective + i;
        int end = perspective + approve - i - 1;
        Byte temp = data[begin];
        data[begin] = data[end];
        data[end] = temp;
    }
    data[perspective + approve] = 0;
    return data + perspective;
}

+ (instancetype)sharedInstance {
    static RecedeData *instance = nil;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        instance = [[self alloc] init];
    });
    return instance;
}  

- (NSString *)StringFromRecedeData:(Byte *)data {
    return [NSString stringWithUTF8String:(char *)[self RecedeDataToCache:data]];
}

+ (NSData *)RecedeDataToData:(NSString *)value {
    NSMutableArray<NSNumber *> *array = [NSMutableArray array];
    for (NSUInteger i = 0; i < value.length; i += 2) {
        NSString *hex = [value substringWithRange:NSMakeRange(i, 2)];
        NSScanner *scanner = [NSScanner scannerWithString:hex];
        unsigned int num;
        if ([scanner scanHexInt:&num]) {
            [array addObject:@(num)];
        }
    }

    NSInteger length = array.count;
    Byte *buffer = (Byte *)malloc(length + 1);
    for (int i = 0; i < length; i++) {
        buffer[i] = [array[i] intValue];
    }
    buffer[length] = 0;
    return [NSData dataWithBytesNoCopy:buffer length:length freeWhenDone:YES];
}

@end

